Let $k\geq 2$ be an integer. Consider the square grid comprising all $(x,y)$ ordered pairs, where $0\leq x, y\leq k$. Let $f$ be a function whose domain is the set of such grid points and whose range is the set of natural numbers (including zero). Suppose that $f$ satisfies the following three properties:

1. For any $a < b\leq k$, it holds that $f(a)=f(b)$;
2. For any $a \neq b$, $f(a)\neq f(b)$;
3. For any nonzero integer $d$, if $(a,b)$ and $(ac,bc)$ have the same function value, then $(a+bd,b+cd)$ also shares the same function value.

Find a function $f$ that satisfies these conditions and determine the minimum possible value of $|f(1)-f(0)|+\cdots+|f(k)-f(0)|$.

